  false,\n\t\"url\": null,\n\t\"notes\": \"Hourly measurements made by selected ship
  sensors on the R/V Seward Johnson during the \"Operation Deep Scope 2005\" expedition
  sponsored by the National Oceanic and Atmospheric Administration (NOAA) Office of
  Ocean Exploration, August 19 through September 4, 2005. Measurements include ship's
  position and heading, chlorophyll-a (fluorometer), and total solar irradiance. This
  data set was compiled from Virtual Instrument Data System (VIDS) ASCII files provided
  by the University of Miami Marine Technology Group at Harbor Branch Oceanographic
  Institution.\",\n\t\"owner_org\": \"9cda5205-d632-4814-96e7-a4ab5e0dce85\",\n\t\"extras\":
